import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { Button } from "../components/ui/button";
import { Card, CardContent } from "../components/ui/card";

const SavedQuotes = () => {
  const [quotes, setQuotes] = useState([]);
  const [filteredQuotes, setFilteredQuotes] = useState([]);
  const [searchTerm, setSearchTerm] = useState("");
  const [selectedRep, setSelectedRep] = useState("");
  const [startDate, setStartDate] = useState("");
  const [endDate, setEndDate] = useState("");
  const navigate = useNavigate();


  useEffect(() => {
    const stored = localStorage.getItem("quotes");
    if (stored) {
      const parsed = JSON.parse(stored);
      setQuotes(parsed);
      setFilteredQuotes(parsed);
    }
  }, []);

  useEffect(() => {
    let filtered = quotes.filter((quote) =>
      quote.customer?.name?.toLowerCase().includes(searchTerm.toLowerCase())
    );

    if (selectedRep) {
      filtered = filtered.filter((quote) => quote.salesRep === selectedRep);
    }

    if (startDate) {
      filtered = filtered.filter((quote) => new Date(quote.date) >= new Date(startDate));
    }

    if (endDate) {
      filtered = filtered.filter((quote) => new Date(quote.date) <= new Date(endDate));
    }

    setFilteredQuotes(filtered);
  }, [searchTerm, selectedRep, startDate, endDate, quotes]);

  const handleEditQuote = (quote) => {
    localStorage.setItem("activeQuote", JSON.stringify(quote));
    navigate("/new-quote");
  };

  const uniqueReps = Array.from(new Set(quotes.map((q) => q.salesRep))).filter(Boolean);

  return (
    <div className="p-6 space-y-4">
      <h1 className="text-2xl font-bold mb-4">Saved Quotes</h1>

      <div className="grid grid-cols-1 md:grid-cols-4 gap-4 mb-4">
        <input
          type="text"
          className="p-2 border rounded w-full"
          placeholder="Search by customer name..."
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
        />

        <select
          className="p-2 border rounded w-full"
          value={selectedRep}
          onChange={(e) => setSelectedRep(e.target.value)}
        >
          <option value="">All Sales Reps</option>
          {uniqueReps.map((rep, i) => (
            <option key={i} value={rep}>{rep}</option>
          ))}
        </select>

        <input
          type="date"
          className="p-2 border rounded w-full"
          value={startDate}
          onChange={(e) => setStartDate(e.target.value)}
        />

        <input
          type="date"
          className="p-2 border rounded w-full"
          value={endDate}
          onChange={(e) => setEndDate(e.target.value)}
        />
      </div>

      {filteredQuotes.length === 0 ? (
        <p className="text-gray-600">No saved quotes found.</p>
      ) : (
        <div className="space-y-4">
          {filteredQuotes.map((quote) => (
            <Card key={quote.id} className="p-4">
              <CardContent className="space-y-2">
                <div className="flex justify-between">
                  <div>
                    <p className="font-semibold">{quote.customer.name}</p>
                    <p className="text-sm text-gray-500">{quote.customer.phone}</p>
                  </div>
                  <div className="text-right">
                    <p className="text-sm text-gray-500">
                      {new Date(quote.date).toLocaleDateString()}
                    </p>
                    <p className="font-semibold">${quote.total.toFixed(2)}</p>
                  </div>
                </div>
                <div className="text-sm text-gray-600">
                  Items: {quote.items.length} | Sales Rep: {quote.salesRep}
                </div>
                <div className="pt-2">
                <Button onClick={() => handleEditQuote(quote)}>Edit</Button>
                </div>
              </CardContent>
            </Card>
          ))}
        </div>
      )}
    </div>
  );
};

export default SavedQuotes;
